import React, { Component } from 'react';

import './css/background.css';

import { Jumbotron } from 'react-bootstrap';

export default class background extends Component {
  render() {
    return (
      <>
        <Jumbotron id="fundo-inicio">
        </Jumbotron>
      </>
    );
  }
}
